import React, { Fragment } from 'react';
import MobileLayoutLevel2 from '../../components/layouts/MobileLayoutLevel2';
import css from '../../styles/main.scss';

const CustomerService = prop => {
  return (
    <Fragment>
      <MobileLayoutLevel2 title="變更資料">
        <div
          className={css.mobileBox}
          style={{ height: 'auto', paddingBottom: 80 }}
        >
          <img src="/images/qrCode.png" alt="" className="img-responsive" style={{height:123}}/>
        </div>
      </MobileLayoutLevel2>
    </Fragment>
  );
};

export default CustomerService;
